  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Tamarac NWR outlines
  Refuge accomplishments from May through August of 1952. The report begins by summarizing
  the weather conditions and water conditions during this period. Wildlife- including
  migratory birds, upland game birds, big game animals, furbearers, predators, rodents,
  mammals, raptors, and fish- is also covered. The Refuge development and maintenance
  section discusses physical developments, plantings, and collections and receipts.
  Resource management is outlined; topics include grazing, haying, and timber removal.
  A progress report on field investigations and applied research is also provided.
  The public relations section of the report describes recreational uses, Refuge visitors,
  Refuge participation, fishing, and violations. N-R forms and photographs are attached.\",\n\t\"license_title\":
